import React, { useState } from 'react';
import Navigation from '../navigation/Navigation';
import "../style.css"
const Ajout = () => {
    const [valera, setaValera] = useState("")
    const makavalera = (e) => {
        setaValera(e.currentTarget.value)
    }
    const [nombre, setNombre] = useState("")
    const calculer = (e) => {
        setNombre(e.currentTarget.id)
    }
    return (
        <div>
            <h3>Page Ajout</h3>
            <Navigation />
            <form action="">
                <p className="resultat">f</p>
                <label htmlFor="">Nom</label><input onChange={makavalera} type="text" value={valera} />
                <br />
                <label htmlFor="">prenom</label><input onChange={makavalera} type="text" /><br />
                <button type="submit">calculer</button>

            </form>
            <p>{valera}</p>
            <div className="vatana">
                <p className="resultat">{nombre}</p>
                <button onClick={calculer} id="9">9</button>
                <button onClick={calculer} id="8">8</button>
                <button id="7">7</button>
                <button onClick={calculer} id="6">6</button>
                <button onClick={calculer} id="5">5</button>
                <button onClick={calculer} id="4">4</button>
                <button onClick={calculer} id="3">3</button>
                <button onClick={calculer} id="2">2</button>
                <button onClick={calculer} id="">1</button>
                <button onClick={calculer} id="0">0</button>
                <button onClick={calculer} id=".">.</button>
                <button onClick={calculer} id="+">+</button>
                <button onClick={calculer} id="/">/</button>
                <button onClick={calculer} id="-">-</button>
                <button onClick={calculer} id="clear">C</button>
                <button onClick={calculer} id="equal">=</button>

            </div>


        </div>
    );
};

export default Ajout;
